import React from 'react';
import axios from 'axios';

const ImgShow = (props) => {
   const img = axios.get(`https://api.unsplash.com/search/photos?page=1&query=${props.name}`)
    
  return (
    <>
      <div>
        <img src={img} alt="any image"/>
      </div>
    </>
  )
}

export default ImgShow
